import React from "react";

const Result = ({ result, onRestart }) => {
    return (
        <div className="result">
            <h1>
                {result === "win"
                    ? "You Win!"
                    : result === "lose"
                    ? "You Lose!"
                    : "Draw!"}
            </h1>
            <button onClick={onRestart}>Restart Game</button>
        </div>
    );
};

export default Result;
